import React from "react";

const Studentreg = () => {
  return (
    <div className="border-gray-500  w-1/2 rounded-lg bg-gray-200 h-max">
      <div className=" flex justify-center align-top h-64 max-w-5xl border-black border-0">
        <h1>Register New Student</h1>
      </div>
    </div>
  );
};

export default Studentreg;
